import React from 'react';

function ReservationPage() {
  return (
    <div className="page-container">
      <h2>예약 안내</h2>
      <p>프로그램 예약 및 신청을 이곳에서 할 수 있습니다.</p>
    </div>
  );
}

export default ReservationPage;
